import { useState } from "react";

function Register() {

    const [formData, setFormData] = useState({
        firstName: "",
        lastName: "",
        username: "",
        password: "",
        confirmPassword: ""

    });




        const handleChange = evt => {
            console.log(evt.target)
            // const { name, value } = evt.target;
            // setFormData(fData => ({
            //   ...fData,
            //   [name]: value
            // }));


          }







    return (

        <section className="intro">
            <div className="mask d-flex align-items-center h-100" style={{ backgroundColor: "#D6D6D6" }}>
                <div className="container">
                    <form className="row justify-content-center" onChange={handleChange}>
                        <div className="col-12 col-md-8 col-lg-6 col-xl-5">
                            <div className="card" style={{ borderRadius: "1rem" }}>
                                <div className="card-body p-5 text-center">

                                    <div className="my-md-5 pb-5" >

                                        <h1 className="fw-bold mb-5">Register</h1>

                                        <div className="form-outline mb-3">
                                            <label className="form-label" htmlFor="first">First Name</label>
                                            <input name="firstName" type="input" id="first" className="form-control form-control-lg" />
                                        </div>
                                        <div className="form-outline mb-3">
                                            <label className="form-label" htmlFor="last">Last Name</label>
                                            <input name="lastName" type="input" id="lastName" className="form-control form-control-lg" />
                                        </div>
                                        <div className="form-outline mb-3">
                                            <label className="form-label" htmlFor="typeEmail">Email</label>
                                            <input name="email" type="email" id="typeEmail" className="form-control form-control-lg" />
                                        </div>

                                        <div className="form-outline mb-4">
                                            <label className="form-label" htmlFor="typePassword" >Password</label>
                                            <input name="password" type="password" id="typePassword" className="form-control form-control-lg" autoComplete="current password" />
                                        </div>

                                        <div className="form-outline mb-4">
                                            <label className="form-label" htmlFor="typePassword" >Confirm Password</label>
                                            <input name="password" type="password" id="confirmPassword" className="form-control form-control-lg" autoComplete="confirm password" />
                                        </div>

                                        <button className="btn btn-primary btn-lg btn-rounded gradient-custom text-body px-5" type="submit">Submit</button>

                                    </div>

                                    <div>
                                        <p className="mb-0">Already have an account? <a href="#!" className="text-body fw-bold">Login</a></p>
                                    </div>

                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </section>
    )

}







export default Register;
